require("isomorphic-fetch");

function addName(time) {
  return fetch('http://localhost:3000').then(function(resp)
    {
      return resp.json();
    });
}

function handleError(error) {
  console.warn(error);
  return null;
}

module.exports = {
  getInfo: function(time) {
    return addName(time).catch(handleError);
  }
};
